cros_point_data Ray::cros_point(Wall &wall)
{
    double x1,x2,x3,x4;
    double y1,y2,y3,y4;
    double den,t,u;
    double pt_x, pt_y;
    double cden,yv,xv;

    x1 = wall.ax;
    y1 = wall.ay;
    x2 = wall.bx;
    y2 = wall.by;

    x3 = x;
    y3 = y;
    x4 = x + dir_x;
    y4 = y + dir_y;

    den = (x1 - x2) * (y3 - y4) - (y1 - y2) * (x3 - x4);

    if (den == 0)
    {
        return cros_point_data {false, 0, 0};
    }

    
    t =  ((x1 - x3) * (y3 - y4) - (y1 - y3) * (x3 - x4)) / den;
    u = -((x1 - x2) * (y1 - y3) - (y1 - y2) * (x1 - x3)) / den;    

    if (t > 0 and t < 1 and u > 0)
    {
        
        pt_x = x1 + t * (x2 - x1);
        pt_y = y1 + t * (y2 - y1);

        // cden  = (x1-x2)*(y3-y4)-(y1-y2)*(x3-x4); 
        // xv = (x1*y2-y1*x2)*(x3-x4) - (x1-x2)*(x3*y4-y3*x4);
        // yv = (x1*y2-y1*x2)*(y3-y4) - (y1-y2)*(x3*y4-y3*x4);
        // pt_x = xv/cden;
        // pt_y = yv/cden;
        
        return cros_point_data {true, pt_x, pt_y};
    }
    else
    {
        return cros_point_data {false, 0, 0};
    }
}

Wall::Wall(double _ax, double _ay, double _bx, double _by, fb_buf &_buf)
{
    ax = _ax;
    ay = _ay;
    bx = _bx;
    by = _by;
    buf = &_buf;
}

void Wall::draw_wall()
{
    buf->draw_line(ax,ay,bx,by);
}

int Wall::get_pixel_column(double _x, double _y)
{   int col = (int) ( sqrt( pow(ax-_x,2) + pow(ay-_y,2) ) );
    // printf("%d %lf %lf\n\n", col, _x, _y);
    // printf("sqrt((%lf-%lf)^2 + (%lf-%lf)^2)\n\n\n",ax ,_x ,ay,_y);
    return col % 64;
}

Camera::Camera(int _x, int _y, int _count_of_rays, double _view_angle, double _rotation_angle, fb_buf &_buf)
{
    x = _x;
    y = _y;
    count_of_rays = _count_of_rays;
    view_angle = _view_angle;
    rotation_angle = _rotation_angle;
    buf = &_buf;
    for(int i=0; i<count_of_rays; i++)
    {
        rays.push_back(Ray (x,
                            y,
                            rotation_angle-(view_angle/2)+(view_angle/(count_of_rays-1)*i),
                            _buf));        
    }

}

Camera::~Camera(){};

void Camera::move(int dist)
{
    x += cos(rotation_angle)*dist;
    y += sin(rotation_angle)*dist;
    for(int i = 0; i<rays.size(); ++i)
    {
        rays[i].set_cords(x,y);
    }
}

void Camera::move_to(int _x, int _y)
{
    x = _x;
    y = _y;
    for(int i = 0; i<rays.size(); ++i)
    {
        rays[i].set_cords(x,y);
    }
}

void Camera::rotate(double _angle)
{
    rotation_angle += _angle;
    for(int i=0; i<count_of_rays; i++)
    {
        rays[i].angle = rotation_angle-(view_angle/2)+(view_angle/(count_of_rays-1)*i);
        rays[i].dir_x = cos(rays[i].angle);
        rays[i].dir_y = sin(rays[i].angle); 
    }

}

double Camera::get_distance (double x1, double  y1, double  x2, double  y2)
{
    return sqrt( (pow((x1-x2),2) + pow((y1-y2),2)));
}

std::vector<ray_cast_return> Camera::ray_cast(std::vector<Wall> walls)
{
    std::vector<ray_cast_return> ret;
    double d,dx,dy,nd;
    Wall w=walls[0];
    cros_point_data cords;
    for(int i = 0; i<count_of_rays; ++i)
    {
        d = INFINITY;
        dx = 0; dy = 0;
        w = walls[0];
        for(int j=0; j<walls.size(); ++j)
        {
            cords = rays[i].cros_point(walls[j]);
            if(cords.is_point)
            {
                nd = get_distance(rays[i].x,rays[i].y,cords.x,cords.y);
                if(nd<d)
                {
                    d = nd;
                    w = walls[j];
                    dx = cords.x;
                    dy = cords.y;
                }
            }
        }
        if(d!= INFINITY)
        {
            // rays[i].draw_line((int)dx,(int)dy);
            ret.push_back(ray_cast_return{i,dx,dy,d,&w});
        }
    }
    data_for_render = ret;
    return ret;
}

